window.bookSummaryJSON = "<p>Aeronautilus must fight tooth and nail to survive this trippy journey to the Currency Tournament. He is born to surf the waves of the coast, yet God and fate needed him stronger. So Aero must leave his family and friends, and battle foes in hopes that he will return back to his old life. Yet what he has yet to learn is that Gemini Soul is his family and home. Join Aero as he finds himself in the midst of an unforgettable epic.</p>"; 
